Aggregate multiple collections based on student Id<p>I am trying to aggregate 2 collections in MongoDB based on a student's ID. One collection consists of student personal information, another one consists of the students logs. The issue is that the data is in array which is why I think my aggregation is not working. Any help will be appreciated.</p>

<p><strong>student collection</strong></p>

<pre><code>{
    "_id" : ObjectId("(Object ID here"),
    "data" : [ 
        {
            "name" : "John",
            "id" : 1
        }, 
        {
            "name" : "Sandy",
            "id" : 2
        }
    ]
}
</code></pre>

<p><strong>logs collection</strong></p>

<pre><code>{
    "_id" : ObjectId("(Object ID here"),
    "logs" : [ 
        {
            "studentId" : 1,
            "activity" : "11112,334,123"
        }, 
        {
            "studentId" : 2,
            "activity" : "11112,334,123"
        }
    ]
}
</code></pre>

<p>Here is what I have tried:</p>

<pre><code>dbo.collection("student").aggregate([
    { "$lookup": {
        "localField": "data.id",
        "from": "logs",
        "foreignField": "logs.studentId",
        "as": "studentInfo"
    }
    }]).toArray(function(err, results) {
        console.log(results);
    });
</code></pre>

<p>Expected result:</p>

<pre><code>studentinfo: {
    id: 1,
    name: "John",
    activity" : "11112,334,123"
}
</code></pre>

