<p>This is the function I'm using to return the results.</p>

<pre><code>router.get('/', (req, res) =&gt; {
  const errors = {};
  Person
    .find()
    .limit(pagingLimit)
    .sort(
      {year:[0]}
    )
    .then(people =&gt; {
      if (!people) {
        errors.noprofile = 'There are no profiles';
        res.status(404).json(errors);
      }

      return res.json(people)
    })
    .catch(err =&gt; res.status(404).json({
        nopeoplefound: 'No people found'
