node mongodb 3.4 using find with specify fields and toArray does not filter results<p>Again, using mongo v3.4 and referencing these docs: <a href="https://docs.mongodb.com/v3.4/tutorial/project-fields-from-query-results/" rel="nofollow noreferrer">https://docs.mongodb.com/v3.4/tutorial/project-fields-from-query-results/</a></p>

<p>My example looks like:</p>

<pre><code>    const m = this.getCollection(SOME_COLLECTION);
    m.find({
        '_id': {
            $nin: [Ace, Bay],
        },
        'value.someCategory': {
            $type: 'object',
        },
    }, {
        '_id': 0,
        'value.someCategory': 1,
    }).toArray((err, doc) =&gt; {
        if (err) {
            console.log(err);
        } else {
            console.log(doc);
        }
    });
</code></pre>

<p>My <code>doc</code> array will return all items that follow my filter of <code>value.someCategory</code> of type object, but will not remove the <code>_id</code> and will return all fields even though I'd like to specify only the <code>value.someCategory</code> field.</p>

<p>Example data in mongo:</p>

<pre><code>[
    {
      _id: 'hello',
      value: {
        someCategory: [Object],
        name: 'hello',
        otherCategory: true,
      }
    },
    {
      _id: 'Ace',
      value: {
        someCategory: [Object],
        name: 'Ace',
        otherCategory: true,
      }
    },
    {
      _id: 'testing',
      value: {
        someCategory: null,
        name: 'testing',
        otherCategory: true,
      }
    },
]
</code></pre>

<p>And expect the result to be:</p>

<pre><code>[
    {
      someCategory: [Object],
    },
]
</code></pre>

<p>Based on the docs linked above, the specified fields should be the second param. I'm wondering now if the use of <code>toArray</code> affects the return value?</p>

